import React from 'react'
import styles from './Navigation.module.css'

import { Link } from 'react-router-dom';


const Navigation = () => {
    return (
      <nav className={styles.nav}>
        <ul>

            <li>
              <a href="/">videos</a>
            </li>


            <li>
              <Link to='/contaacto'>photos</Link>
            </li>

        </ul>
      </nav>
    );
  };

  export default Navigation;
